Druid and his honey
 Badu the Bear is a very conscientious druid.
 She will always help and cheer you up with a kind word.
 This time he diligently built houses for the little bees for the winter, day and night hammering nails into boards, collecting roofs.
 The bees wanted to thank such a helper, and together they gave their special honey.
 Oh, how surprised Badu was, honey is so rare, and hungry for so much work!
 "Do good to others, and they will do good to you too"
